.button-group {
  margin: 10px
}

.button {
  padding: 2px 8px;
  border: 1px solid #ccc;
  background: #fff;
  box-shadow: 0 1px 2px rgba(0,0,0,0.2); 
  display: inline-block;
  color: #999;
  font-weight: light;
  cursor: pointer;
}

.button.active {
  box-shadow: inset 0 -1px 2px rgba(0,0,0,0.2);
  background: #eee;
  color: #000;
  font-weight: bold;
}

#chartPopup {
  position: absolute;
  top: 100px;
  left: 100px;
  background: #fff;
  border: 1px solid #ccc;
  box-shadow: 0 2px 2px rgba(0,0,0,0.3);
  border-radius: 2px;
  width: 160px;
  height: 70px;
  margin-left: -80px;
  margin-top: 25px;
  padding: 10px 5px;
  display: none;
  text-align: center;
}
#chartTitleText {
  height: 20px;
  font-size: 1.2em;
  font-weight: bold;
}
#chartCategory {
  font-weight: light;
}
#chartRate {
  font-size: 0.8em;
  margin-bottom: 5px;
  margin-top: 5px;
}

#chartValue {
  font-size: 0.9em;
}

