module = {};
module.exports = plotdb.chart.create({
  name: "New Chart",
  title: "New Chart",
  desc: "No Description",
  author: "Your Name",
  sample: d3.range(200).map(function(it){
    var U = Math.random();
    var V = Math.random();
    var X = d3.range(12).map(function() { return Math.random(); })
      .reduce(function(a,b) { return a + b}, 0);
    return {
      size: parseInt((Math.random()*20 + 5)),
      rate: X * 100,
      name: ["John","James","Amelie","Jack","Bob","Sharon","Jobs","Steve","Emy","Eva"][parseInt(Math.random()*10)],
      category: ["IT","HR","FIN","GM","RD"][it % 5]
    };
  }),
  dimension: {
    size: { type: [plotdb.Number], require: true, desc: "Size of circle" },
    rate: { type: [plotdb.Percent], require: true, desc: "X position of circle" },
    name: { type: [], require: false, desc: "Name of Data" },
    category: { type: [plotdb.String], require: true, desc: "Category of Data"}
  },
  config: {
    padding: { type: [plotdb.Number], default: 10, rebindOnChange: true },
    palette: { type: [plotdb.Palette], default: plotdb.Palette['default'], rebindOnChange: false }
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg").attr({
      width: "100%",
      height: "100%",
      preserveAspectRatio: "xMidYMid"
    });
    for(var idx = 0; idx < this.data.length ;idx ++ ){
      this.data[idx].radius = Math.sqrt( this.data[idx].size );
    }
    this.radiusRange = this.data.map(function(it) { return it.radius; });
    this.categories = d3.map(this.data, function(it) { return it.category; }).keys();
    this.categorySize = d3.max(this.categories.map(function(it) { return it.length; }));
    var ratescale = d3.scale.linear()
      .domain(d3.extent(this.data.map(function(it) { return it.rate;})))
      .range([0,100]);
    for(var idx = 0; idx < this.data.length; idx ++) {
      this.data[idx].rate = ratescale(this.data[idx].rate);
    }
    this.categoryObj = this.categories.map(function(it) {
      return {key: it, y: (that.categories.indexOf(it) + 1) / ( that.categories.length + 1)};
    });
    this.central = true;
  },
  bind: function() {
    var that = this;
    this.svg.selectAll("text.central")
      .data(this.categoryObj)
      .enter().append("text").attr({class: "central"}).text(function(it) { return it.key;});
    this.svg.selectAll("line.central")
      .data(this.categoryObj)
      .enter().append("line").attr({class: "central"});
    var circles = this.svg.selectAll("circle").data(this.data);
    circles.enter().append("circle");
    circles.on("mousemove", function(it) {
      var x = d3.event.clientX;
      var y = d3.event.clientY;
      d3.select("#chartPopup").style({
        display: "block",
        top: y + "px",
        left: x + "px"
      });
      d3.select("#chartTitleText").text(it.name);
      d3.select("#chartCategory").text(" ( " + it.category+" )");
      d3.select("#chartRate").text((parseInt(10 * it.rate)/10) + "%");
      d3.select("#chartValue").text(it.size);
    });
    circles.exit().remove();
    d3.select("#btn-whole").on("click", function() {
      that.central = true;
      for(var idx = 0; idx < that.data.length; idx++ )  {
        that.data[idx].cy = that.h / 2;
      }
      that.force.start();
    });
    d3.select("#btn-category").on("click", function() {
      that.central = false;
      for(var idx = 0; idx < that.data.length; idx++ )  {
        item = that.data[idx];
        item.cy = (that.categories.indexOf(item.category) + 1 )* that.h / (that.categories.length + 1);
      }
      that.force.start();
    });
  },
  tick: function() {
    // collision detection, for prevent circles from overlapping
    var alpha = this.force.alpha();
    // if(alpha < 0.08) this.force.stop();
    for(i = 0; i < this.data.length ; i++) {
      var item = this.data[i];
      if(Math.abs(item.y - item.cy) > 0) {
        item.y = item.y + (item.cy - item.y ) * alpha / 5.0;
      }
      if(Math.abs(item.x - item.cx) > 0) {
        item.x = item.x + ( item.cx - item.x ) * alpha / 2.0;
      }
    }
    for(i = 0 ; i < this.data.length ; i++) {
      for(j = 0 ; j < this.data.length ; j++) {
        it = this.data[i];
        jt = this.data[j];
        if(i==j) continue; // not collide with self
        r = it.r + jt.r;
        itx = it.x;
        ity = it.y;
        jtx = jt.x;
        jty = jt.y;
        d = Math.sqrt( (itx - jtx) * (itx - jtx) + (ity - jty) * (ity - jty) );
        if(r > d) { // distance smaller than radius means collision
          dr = ( r - d ) / ( d * 1 );
          it.x = it.x + ( itx - jtx ) * dr * 0.1;
          it.y = it.y + ( ity - jty ) * dr * 0.1;
        }
    }};
    this.render(this.root, this.data, this.config);
  },
  resize: function() {
    var that = this;
    this.w = $(this.root).width();
    this.h = $(this.root).height();
    this.mh = 10;
    this.mw = 100;
    this.svg.attr({ viewBox: [0,0,this.w,this.h].join(" ") });
    this.xscale = d3.scale.linear().domain([0,100])
      .range([this.mw + this.categorySize * 12, this.w - this.mw]);
    this.rscale = d3.scale.linear().domain(d3.extent(this.radiusRange)).range([1,10]);
    for(var idx = 0; idx < this.data.length ;idx ++ ){
      var item = this.data[idx];
      item.cx = this.xscale(item.rate);
      item.x = item.cx;
      if(that.central) item.cy = that.h / 2;
      else item.cy = (
        (this.categories.indexOf(item.category) + 1 ) * that.h / (this.categories.length + 1)
      );
      item.y = item.cy;
	  item.px = item.x;
	  item.py = item.y;
      item.r = this.rscale(item.radius);
    }
    this.force = d3.layout.force().nodes(this.data)
      .size([this.w,this.h]).gravity(0.05).charge(-10)
      .on("tick", function(){ that.tick(); });
    this.force.size([this.w, this.h]);
    this.force.start();
  },
  render: function() {
    var that = this;
    this.svg.selectAll("circle").attr({
      cx: function(it) { return it.x; },
      cy: function(it) { return it.y; },
      r:  function(it) { return it.r; }
    }).style({
      fill: function(it) {
        var idx = parseInt(it.rate / 17);
        return that.config.palette.colors[idx % that.config.palette.colors.length].hex;
      },
      stroke: "#444",
    });
    this.svg.selectAll("line.central")
      .attr({
        x1: that.mw + this.categorySize * 12,
        x2: that.w - that.mw,
        "stroke-dasharray": "1 2",
        stroke: "#777"
      }).transition().duration(100).attr({
        y1: function(it) { 
          return that.h * (that.central?0.5:it.y);
        },
        y2: function(it) {
          return that.h * (that.central?0.5:it.y);
        },
        opacity: function(it) {
          return (that.central?0.1:0.8);
        }
      });
    this.svg.selectAll("text.central")
      .attr({
        x: that.mw + that.categorySize,
        "text-anchor": "end",
        "baseline-dominant": "central"
      }).transition().duration(100).attr({
        y: function(it) {
          return (that.central?0.5:it.y) * that.h;
        },
        opacity: function(it) {
          return (that.central?0:0.8);
        }
      })
  }
});
